handleClick(){
  let class_id = parseInt(document.querySelector("#classid").value);
  console.log(class_id);
}

  render() {
    return (
      <div>

        <Link to="/ClassResults"><button type="button" className="classBtn" onClick={this.handleClick}>View Class Results</button></Link>

